import Scroll from 'react-scroll';
const ScrollLink = Scroll.ScrollLink;

class Menu extends Component {

render() {
  return (
    <nav>
      <ScrollLink
        to="VideoPlayer"
        spy={true}
        smooth={true}
        duration={500}
        className='some-class'
        activeClass='some-active-class'
      >
      Video Player
      </ScrollLink>
    </nav>
  )
}
}
export default Menu;
